import React, { useState } from "react";

function Planner() {
  const [inputValue, setInputValue] = useState("");

  return (
    <div style={{
      display: "flex",
      minHeight: "100vh",
      backgroundColor: "#dbeeff",
      fontFamily: "Arial, sans-serif"
    }}>
      
      {/* Left Ribbon */}
      <div style={{
        width: "250px",
        backgroundColor: "#003366",
        padding: "20px",
        color: "white",
        display: "flex",
        flexDirection: "column",
        alignItems: "center"
      }}>
        <h2>Input</h2>
        <input
          type="text"
          placeholder="Enter something..."
          value={inputValue}
          onChange={(e) => setInputValue(e.target.value)}
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "100%",
            marginTop: "10px"
          }}
        />
      </div>

      {/* Main Content Area */}
      <div style={{
        flex: 1,
        padding: "40px",
        textAlign: "center"
      }}>
        <h1>Financial Planner</h1>
        <p>Analytics and charts will go here.</p>
      </div>

    </div>
  );
}

export default Planner;
